import ReactDom from 'react-dom';
import {loadState} from './state';

let x =  "x";
function DataBox(props){
    return <div className="dataBox">
        <h1>
            Element Data:
        </h1>
        <h2>
           {loadState}
        </h2>
    </div>
}

export default DataBox;
